import React, { Component } from 'react';
import '../stylesheets/App.css';
import {ProgressBar, Container, ToggleButton,  Col, Row, Navbar, Nav, NavDropdown, Form, FormControl, Button, Carousel, Image, Table, Jumbotron } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import Footer from "./Footer";
import NavHeader from "./NavHeader";
import FollowProject from "./FollowProject";

function ProjectJumbo(props) {
    return (
        <Jumbotron fluid className = "projectJumbo">
            <Image src="https://cdn.dribbble.com/users/94666/screenshots/3256047/brookliv_illo_01b_dribbble.png" />
        </Jumbotron>
    );
}

function ProjectSummary(props) {
    return (
        <Jumbotron fluid className="projectSummary">
            <ProgressBar variant="success" class="projectProgress" animated now={50} />
            <div className = "projectSummaryText">
            <h1>$123,456</h1>
            <p>Already invested into Oakland Housing Association</p>
            <h2>900</h2>
            <p>Socially concious investors</p>
            <h3>$1000</h3>
            <p>Minimum investment package</p>
            </div>
        </Jumbotron>
    );
}

function ProjectTitle(props) {
    return (
        <Jumbotron className="projectTitle">
            <h1>Oakland Home</h1>
            <p>The Oakland Housing Association is acquiring a new property and we're getting them the money. </p>
        </Jumbotron>
    );
}

function ProjectActions(props) {
    return (
        <div className = "projectActions">
            <Button block variant="info">Contribute to this Project</Button>
            <Table>
                <Row className = "actionButtons">
                    <Col>
                        <FollowProject/>
                    </Col>
                    <Col>
                       <Image src="https://i.gyazo.com/4b5ff1a619fceb707d3ba15294ed5e95.png" />
                    </Col>
                </Row>
            </Table>
        </div>
    );
        }
        
class ProjectDashboard extends Component {
    render() {
        return (
            <div className="ProjectDashboard">
                <NavHeader />
                <ProjectTitle />
                <Table fluid>
                    <Row>
                        <Col xs={8}>
                        <ProjectJumbo/>
                        </Col>
                        <Col>
                            <ProjectSummary />
                            <ProjectActions />
                        </Col>
                    </Row>
                </Table>
                <Footer />
                </div>
        );
    }
}

export default ProjectDashboard;
